import React from 'react'

function Status() {

  const fetchData = async () => {
    try {
      const response = await fetch("https://api.dundretlapland.com/backstatus.php");

      if (!response.ok) {
        throw new Error(`HTTP Error! Status: ${response.status}`);
      }
    } catch (error) {
      console.log
    }
  }

  return (
    <div>
      Hello world!
    </div>
  )
}

export default Status
